    body {
      font-family: 'AsgaardFull', sans-serif;
      background-color: black;
      margin: 0;
      overflow: hidden;
    }

    .ticker-wrapper {
      width: 100%;
      white-space: nowrap;
      overflow: hidden;
      position: fixed;
      top: 0;
      left: 0;
      background-color: black;
      padding: 30px 0;
    }

    .ticker {
      display: inline-block;
      padding-left: 100%;
      animation: scroll-left 30s linear infinite;
    }

    .ticker span {
      display: inline-block;
      font-size: 96px;
      color: #0029FF;
      margin: 0 250px;
      text-shadow: 4px 4px 8px #000000;
      font-weight: bold;
    }

    @keyframes scroll-left {
      0% {
        transform: translateX(0%);
      }
      100% {
        transform: translateX(-100%);
      }
    }
  </style>
